import React from "react";
import EVByYearChart from "./EVByYearChart";
import TopMakesChart from "./TopMakesChart";
import VehicleTypesChart from "./VehicleTypesChart";

const Dashboard = ({ data }) => {
  return (
    <div>
      <EVByYearChart data={data} />
      <TopMakesChart data={data} />
      <VehicleTypesChart data={data} />
    </div>
  );
};

export default Dashboard;
